import React, { useState } from 'react';
import axios from 'axios';
import '../styles/ProcessPanel.css';

function ProcessPanel({ onProcessComplete, onLoadMetadata, onError }) {
  const [mode, setMode] = useState('directory');
  const [imageDir, setImageDir] = useState('data/raw/coco-val-2017-500');
  const [modelPath, setModelPath] = useState('yolo11m.pt');
  const [metadataPath, setMetadataPath] = useState('');
  const [loading, setLoading] = useState(false);
  const [uploadedFiles, setUploadedFiles] = useState([]);

  const handleProcessDirectory = async () => {
    if (!imageDir.trim()) {
      onError('Please enter an image directory path');
      return;
    }

    setLoading(true);
    try {
      const response = await axios.post('/api/process-directory', {
        imageDir,
        modelPath
      });

      if (response.data.success) {
        onProcessComplete(response.data.metadata);
      }
    } catch (error) {
      onError(error.response?.data?.error || 'Error processing directory');
    } finally {
      setLoading(false);
    }
  };

  const handleFileUpload = async (e) => {
    const files = Array.from(e.target.files);
    if (files.length === 0) return;

    setLoading(true);
    const formData = new FormData();
    files.forEach(file => formData.append('files', file));
    formData.append('modelPath', modelPath);

    try {
      const response = await axios.post('/api/process-images', formData, {
        headers: { 'Content-Type': 'multipart/form-data' }
      });

      if (response.data.success) {
        setUploadedFiles(files);
        onProcessComplete(response.data.metadata);
      }
    } catch (error) {
      onError(error.response?.data?.error || 'Error uploading images');
    } finally {
      setLoading(false);
    }
  };

  const handleLoadMetadata = async () => {
    if (!metadataPath.trim()) {
      onError('Please enter a metadata file path');
      return;
    }

    setLoading(true);
    try {
      const response = await axios.post('/api/load-metadata', {
        metadataPath
      });

      if (response.data.success) {
        onLoadMetadata(response.data.metadata);
      }
    } catch (error) {
      onError(error.response?.data?.error || 'Error loading metadata');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="process-panel">
      <div className="mode-selector">
        <button
          className={`mode-btn ${mode === 'directory' ? 'active' : ''}`}
          onClick={() => setMode('directory')}
          disabled={loading}
        >
          Directory Processing
        </button>
        <button
          className={`mode-btn ${mode === 'upload' ? 'active' : ''}`}
          onClick={() => setMode('upload')}
          disabled={loading}
        >
          Upload Images
        </button>
        <button
          className={`mode-btn ${mode === 'load' ? 'active' : ''}`}
          onClick={() => setMode('load')}
          disabled={loading}
        >
          Load Metadata
        </button>
      </div>

      {mode === 'directory' && (
        <div className="mode-content">
          <div className="form-group">
            <label>Image Directory Path</label>
            <input
              type="text"
              value={imageDir}
              onChange={(e) => setImageDir(e.target.value)}
              placeholder="e.g., data/raw/coco-val-2017-500"
              disabled={loading}
            />
            <small>Use relative path from project root</small>
          </div>

          <div className="form-group">
            <label>Model Path</label>
            <input
              type="text"
              value={modelPath}
              onChange={(e) => setModelPath(e.target.value)}
              placeholder="yolo11m.pt"
              disabled={loading}
            />
          </div>

          <button
            className="btn btn-primary"
            onClick={handleProcessDirectory}
            disabled={loading}
          >
            {loading ? 'Processing...' : 'Start Inference'}
          </button>
        </div>
      )}

      {mode === 'upload' && (
        <div className="mode-content">
          <div className="form-group">
            <label>Model Path</label>
            <input
              type="text"
              value={modelPath}
              onChange={(e) => setModelPath(e.target.value)}
              placeholder="yolo11m.pt"
              disabled={loading}
            />
          </div>

          <div className="upload-area">
            <input
              type="file"
              multiple
              accept="image/*"
              onChange={handleFileUpload}
              disabled={loading}
              id="file-input"
            />
            <label htmlFor="file-input" className="upload-label">
              {loading ? 'Processing...' : 'Click to upload or drag images here'}
            </label>
          </div>

          {uploadedFiles.length > 0 && (
            <div className="uploaded-files">
              <h4>Uploaded Files ({uploadedFiles.length})</h4>
              <ul>
                {uploadedFiles.map((file, idx) => (
                  <li key={idx}>{file.name}</li>
                ))}
              </ul>
            </div>
          )}
        </div>
      )}

      {mode === 'load' && (
        <div className="mode-content">
          <div className="form-group">
            <label>Metadata File Path</label>
            <input
              type="text"
              value={metadataPath}
              onChange={(e) => setMetadataPath(e.target.value)}
              placeholder="data/processed/coco-val-2017-500/metadata.json"
              disabled={loading}
            />
          </div>

          <button
            className="btn btn-primary"
            onClick={handleLoadMetadata}
            disabled={loading}
          >
            {loading ? 'Loading...' : 'Load Metadata'}
          </button>
        </div>
      )}
    </div>
  );
}

export default ProcessPanel;
